channel.description:
First you need Aryan Snack pack( http://www.savefile.com/files.php?fid=9461218)
and .net framework (http://www.microsoft.com/downloads/details.aspx?FamilyID=fe6f2099-b7b4-4f47-a244-c96d69c35dec&DisplayLang=en)

how to use:
Everytime RS updates, follow these steps:

1. Run Carbon Updater (made by Odie) and hit Start.
   Wait for it to finish. It will say "Done!"
   ~ Time to complete: 2 minutes

1.1. You may need to open the Ground java file and make the declarations public.
     To do this in #362 open INPUT/Class22_Sub3.java and change the following lines:
        public Class46 aClass46_1365;
        public Class4 aClass4_1366;
        Class19 aClass19_1367;
        Class25 aClass25_1368;
        Class48 aClass48_1369;
        Class44 aClass44_1370;
    To:
        public Class46 aClass46_1365;
        public Class4 aClass4_1366;
       public Class19 aClass19_1367;
        public Class25 aClass25_1368;
        public Class48 aClass48_1369;
        public Class44 aClass44_1370;
    ~ Time to complete: 3 minutes

2. Run Update-Aryan.bat
   ~ Time to complete: 3 minutes

2.1. You may have to go into Botclasses/AccessorMethods.java and update the canReach() method.
     This can be done by looking at how it is called in the canReach and comparing
     to how it is called in OUTPUT/client.java
     ~ Time to complete: 5 minutes

3. Run Compile-All.bat
   ~ Time to complete: 1 minute

3.1. If you get errors while compiling, mostly it will have something to do with the minimapInt1 and 2
     To fix that you have to go in defs/definitions.txt , search for minimapInt1 ; and read the RegeX stuff, then you
     have to find the pattern: pattern int \w+ = anInt\d+ \+ anInt\d+ & 0x7ff;\r\n+\s+int \w+ = 48.+/ 32;
     in OUTPUT/client.java ; good luck with finding it, i think it was:
     anInt1034 find and replace by minimapInt1 and
     anInt1021 find and replace by minimapInt2

     there will be another error in it, about doAction() method; it's rather hard to give a good explanation...
